generated.css:
/* http://meyerweb.com/eric/tools/css/reset/
   v2.0 | 20110126
   License: none (public domain)
*/
html, body, div, span, applet, object, iframe, h1, h2, h3, h4, h5, h6, p, blockquote, pre, a, abbr, acronym, address, big, cite, code, del, dfn, em, img, ins, kbd, q, s, samp, small, strike, strong, sub, sup, tt, var, b, u, i, center, dl, dt, dd, ol, ul, li, fieldset, form, label, legend, table, caption, tbody, tfoot, thead, tr, th, td, article, aside, canvas, details, embed, figure, figcaption, footer, header, hgroup, menu, nav, output, ruby, section, summary, time, mark, audio, video {
  margin: 0;
  padding: 0;
  border: 0;
  font-size: 100%;
  font: inherit;
  vertical-align: baseline; }

/* HTML5 display-role reset for older browsers */
article, aside, details, figcaption, figure, footer, header, hgroup, menu, nav, section {
  display: block; }

body {
  line-height: 1; }

ol, ul {
  list-style: none; }

blockquote, q {
  quotes: none; }

blockquote:before, blockquote:after {
  content: '';
  content: none; }

q:before, q:after {
  content: '';
  content: none; }

table {
  border-collapse: collapse;
  border-spacing: 0; }

@font-face {
  font-family: "NunitoSans-Light";
  src: url("24518a5d1eef97e29c3995408ce00b4d.ttf"); }

@font-face {
  font-family: "NunitoSans-Regular";
  src: url("1a8304b4e854ec023a9e0104b8a24715.ttf"); }

@font-face {
  font-family: "NunitoSans-SemiBold";
  src: url("5eef6c6322212bbbd643ac667ad18f9a.ttf"); }

@font-face {
  font-family: "NunitoSans-Bold";
  src: url("c8ef920c711a055e8d0b9caa140ba2b7.ttf"); }

.header {
  text-align: center;
  padding: 6rem 0;
  background: linear-gradient(-0.125turn, #8B83FF, #82D3FF); }
  .header-title {
    font-size: 2.4rem;
    font-family: "NunitoSans-Bold";
    color: #8B83FF; }
    @media (min-width: 600px) {
      .header-title {
        font-size: 3rem; } }
  .header-subTitle {
    font-size: 1.8rem;
    font-family: "NunitoSans-Light"; }
    @media (min-width: 600px) {
      .header-subTitle {
        font-size: 3rem; } }

.text {
  font-family: "NunitoSans-Regular"; }

.text2 {
  font-family: "NunitoSans-SemiBold"; }
